import { useState } from 'react';
import { useNavigate } from 'react-router-dom';


function Findpw() {

  return (
    <div>
      <form>
        <input
          type='text'
          placeholder='id'
        />
        <input
          type='password'
          placeholder='pw'
        />
        <button>회원가입</button>
      </form>
    </div>
  )
}

export default Findpw;
